    "Stillwater Wildlife Management Area Populations management : Trapping plan",nt"tracking_summary":
    {ntt"total": 4,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T22:18:23.343143",nt"name": "stillwater-wildlife-management-area-populations-management-trapping-plan",nt"isopen":
    false,nt"url": null,nt"notes": "The proposed action is a revision of the
    30 year old fur harvesting plan. This includes: 1) The establishment of a trapping
    permit system for the entire Stillwater Wildlife Management Area. In the past, permits
    were required only for the Refuge portion of the management area. New regulations
    of the Nevada Department of Wildlife now require that trappers on the SWMA obtain
    a permit issued by the federal refuge manager. 2) A lottery among qualified applicants.
     Eligibility and area assignments will be based on qualifications, or the use of
    a bid system. 3) The inclusion of coyote trapping. The old plan did not mention
    this species. In effect, past activities will now be more controlled and better
    enforced and some estimate of the take of target and non-target species can now
    be developed. The number of trappers using the SWMA can be limited. Selected trappers
    will now be assigned to and segregated by units, required to report harvest and
    other activities. Permits can be revoked for noncompliance and new permits denied
    to those who fail to comply with regulations. Permits can also be terminated if
    conflicts arise.",nt"license_title": "License Not Specified",nt"extras":
